class Solution1(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        target = set(p)
        target1 = sorted(p)
        i = 0
        n = len(s)
        n2 = len(p)
        res = []

        while i <= n - n2:
            if set(s[i:i + n2]) == target:
                if sorted(s[i:i + n2]) == target1:
                    res.append(i)
            i += 1
        return res


class Solution2(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        s_len = len(s)
        p_len = len(p)

        s_count = [0] * 26
        p_count = [0] * 26

        for i in p:
            p_count[ord(i) - ord('a')] += 1
        res = []
        i, j = 0, 0
        while i < s_len - p_len + 1:
            if j - i < p_len:
                s_count[ord(s[j]) - ord('a')] += 1
                j += 1
            elif j - i == p_len:
                if (s_count == p_count):
                    res.append(i)
                s_count[ord(s[i]) - ord('a')] -= 1
                i += 1

        return res


class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        s_len = len(s)
        p_len = len(p)

        s_count = [0] * 26
        p_count = [0] * 26
        if s_len < p_len:
            return []

        for i in range(p_len):
            p_count[ord(p[i]) - ord('a')] += 1
            s_count[ord(s[i]) - ord('a')] += 1
        res = []
        if p_count == s_count:
            res.append(0)
        for i in range(s_len - p_len):
            s_count[ord(s[i]) - ord('a')] -= 1
            s_count[ord(s[i + p_len]) - ord('a')] += 1
            if s_count == p_count:
                res.append(i + 1)

        return res


